import './Table.css';

function Table() {
  return (
    <div className="table">
      <table className="table_unit">
        <thead>
          <tr>
            <th>Имя пользователя</th>
            <th>E-mail</th>
            <th>Дата регистрации</th>
            <th>Рейтинг</th>
            <th>''</th>
          </tr>
        </thead>

      </table>
    </div>
  );
}

export default Table;
